import React from 'react';
import {FirstName, LastName} from './App';

const CompC = () => {
    return (
        <>
            <FirstName.Consumer>
                {(fName) => {
                    return (
                        <LastName.Consumer >
                            {(lName) => {
                                <h1>Hello I am {fName}</h1>
                            }}
                        </LastName.Consumer>
                    );
                }}
            </FirstName.Consumer>

        </>
    );
}

export default CompC;
